sample: '["\"Vj Oana de la MTV \u0219i-a cump\u0103rat o geant\u0103 c\u00e2nt\u0103toare!\\nVj
  Oana de la MTV \u0219i-a achizi\u021bionat recent o geant\u0103 c\u00e2nt\u0103toare!
  Pentru c\u0103 este dependent\u0103 de muzic\u0103, de cur\u00e2nd t\u00e2n\u0103ra
  VJ-ita MTV \u0219i-a cump\u0103rat cea mai muzical\u0103 po\u0219et\u0103, dotat\u0103
  cu boxe \u0219i i-pod. \u201cM-am indr\u0103gostit de   imediat ce am v\u0103zut-o.
  Am considerat c\u0103 este un must-have pentru oricine lucreaz\u0103 \u00een domeniul
  muzical, a\u0219a c\u0103 nu am stat pe g\u00e2nduri \u0219i am achitat 30 de lire
  \u00een schimbul ei. A devenit un fel de trade mark al meu a\u0219a c\u0103 nu prea
  mai plec f\u0103r\u0103 ea de-acas\u0103. Are \u00een dotare dou\u0103 difuzoare
  puternice \u0219i un i-pod pe care l-am umplut deja cu piesele mele preferate. Evident
  c\u0103 nu a trecut neobservat\u0103 \u0219i a fost deja vedeta unui party de \u00eenceput
  de an\u201d, a declarat VJ-ita MTV foarte \u00eenc\u00e2ntat\u0103.\\nS-a \u00eentamplat
  deseori ca Vj Oana s\u0103-\u0219i socheze telespectatorii la MTV Dance Floor Chart,
  MTV Fresh \u0219i MTV Week-End Special de foarte multe ori cu \u021binutele excentrice
  pe care le-a purtat. F\u0103r\u0103 \u00eendoial\u0103, Oana se identific\u0103
  cu t\u00e2n\u0103ra genera\u021bie pe care o reprezint\u0103 \u0219i se poate spune
  despre ea c\u0103 este un trendsetter ce d\u0103 tonul nu numai \u00een materie
  de muzic\u0103 bun\u0103, dar \u0219i pe segmetul mod\u0103.\\n\u00cen materie de
  fashion, Oana consider\u0103 c\u0103 nu este neap\u0103rat necesar s\u0103 urmezi
  trendurile, ci totul st\u0103 \u00een atitudine. \u201cCel mai important lucru este
  ca oamenii s\u0103 se simt\u0103 bine \u00een pielea lor\u201d, adaug\u0103 Oana.\\n\u0218tefania
  Stancu\"", "\"Aurescu : Rom\u00e2nia sus\u021bine aderarea Ucrainei la UE dar aceasta
  nu va avea loc prea cur\u00e2nd\\nBogdan Aurescu a fost \u00eentrebat, luni, la
  B1 Tv, dac\u0103 el crede c\u0103 aderarea Ucrainei la Uniunea European\u0103 s-ar
  putea produce \u00een regim de urgen\u0163\u0103. \u201cPerspectiva european\u0103
  a Ucrainei este o realitate. \u015ei Ucraina, dar \u015fi Republica Moldova, \u015fi
  Georgia au perspectiva de a fi \u00eentr-un viitor mai mult sau mai pu\u0163in apropiat,
  asta depinde de propriile performan\u0163e, s\u0103 fie membre ale Uniunii Europene.
  Nimeni nu poate s\u0103 retrag\u0103 aceast\u0103 perspectiv\u0103 acestor state.
  Este adev\u0103rat c\u0103 \u00een ultimii ani a existat un fel de reticen\u0163\u0103
  din partea unora dintre statele membre ale Uniunii Europene, mai ales din partea
  de vest a Uniunii, \u00een a accepta introducerea \u00een documentele UE a acestei
  referiri, la perspectiva european\u0103\u201d, a explicat ministrul de externe.\\nEl
  a precizat c\u0103 Rom\u00e2nia sus\u0163ine aderarea Ucrainei, Republicii Moldova
  \u015fi Georgiei la Uniunea European\u0103. \u201cNoi, Rom\u00e2nia, sus\u0163inem
  perspectiva european\u0103 \u015fi pentru Ucraina, \u015fi pentru Republica Moldova,
  \u015fi pentru Georgia, dar noi am fost primul stat membru al UE care a ratificat
  acordul de asociere \u015fi respectiv acordul de liber schimb al Ucrainei, al Republicii
  Moldova \u015fi al Georgiei, am f\u0103cut o ratificare \u00eempreun\u0103, la pachet,
  a acestor acorduri. \u015ei cred c\u0103 este foarte util, inclusiv \u00een acest
  context, care este un context cu totul \u015fi cu totul special, de criz\u0103,
  cred c\u0103 este foarte bine s\u0103 reiter\u0103m existen\u0163a acestei perspective
  european\u0103 pentru Ucraina ca \u015fi pentru Republica Moldova ca \u015fi pentru
  Georgia. \u00cens\u0103, \u00eentr-adev\u0103r, o aderare foarte rapid\u0103 este
  de greu de realizat, inclusiv din punct de vedere procedural. Aderarea la UE presupune
  un proces foarte serios de reform\u0103 profund\u0103, care ia timp, care necesit\u0103
  foarte multe eforturi, at\u00e2t din partea statului candidat, c\u00e2t \u015fi
  din partea Uniunii Europene\u201d, a afirmat Bogdan Aurescu.\"", "\"Videoclip Andra
  Drumul vietii ne desparte\\nAndra - Drumul vietii ne desparte\\nMelodia face parte
  de pe albumul De la frate la sora, aparut in anul 2007, la casa de discuri MediaPro
  Music.\\nDa click mai jos pentru a vedea versurile piesei Andra - Drumul vietii
  ne desparte.\\nVoteaza aceasta piesa:\\n3\\nvoturi\\ndin\\nComunica cu Andra\\nAnonim
  a scris pe Twitter: @AndraMusic bravo andra esti o femeie extraordinaravezi tot\\nAnonim
  a scris pe Twitter: Andra esti o femeie minunata , o mamica de exceptie,si chiar
  un model de urmat in viata! cu toate ca ai de cresut un copil si de avut grija de
  familivezi tot\\nAnonim a scris pe Twitter: imi place la nebunie melodia,,k la meteovezi
  tot\\nZancu Andreea Zancu Andreea a scris pe Facebook: Andra,esti o cantareata cu
  o voce foarte buna si esti si foarte frumoasa.Succes in continuare in muzica si
  in tot ceea ce faci.Te iubesc!<3vezi tot\\nScrie-i acum!\"", "\"Descriere\\nSpalator
  de vase. Setul contine 3 bureti. Nu ruginesc, rezista timp indelungat. Se folosesc
  cu apa si detergent. Se folosesc manusi de protectie.\\n- Usor de utilizat\\n- Curatare
  usoara si eficienta\\n- Dimensiuni: 47 x 38 x 30 mm\\n- Greutate: 8 g.\\nconsumabilecuratenie.ro
  face eforturi permanente pentru a pastra acuratetea informatiilor din aceast\u0103
  pagina. Rareori acestea pot contine inadvertente; fotografia are caracter informativ
  si poate contine accesorii neincluse \u00een pachetele standard. Unele specificatii
  pot fi modificate de catre producator fara preaviz sau pot contine erori de operare.
  Toate promotiile prezente in site sunt valabile \u00een limita stocului disponibil.\\nMultumim
  pentru in\u021belegere.\\nRecenzii\\nNu exist\u0103 recenzii p\u00e2n\u0103 acum.\"",
  "\"Pe 28 decembrie 2018, la ini\u0163iativa lui Ciprian Sila\u015fi, \u201dr\u0103zboinicii\u201d
  Iulian P\u00eetea, Corina Petru\u0163 \u015fi C\u0103t\u0103lin Dumitrescu, dar
  \u015fi \u201dfaimosul\u201d Yamato Zaharia, au participat la un eveniment caritabil
  destinat pu\u015ftilor de la o \u015fcoal\u0103 din Sibiu. La manifestare au participat
  peste 100 de copii, a\u015fa c\u0103 s\u00e2mb\u0103t\u0103, 19 ianuarie, experien\u0163a
  se va repeta la o \u015fcoal\u0103 din Bra\u015fov.\\nToat\u0103 artileria grea
  de la Exatlon 2 - printre care Beatrice Olaru, Ciprian Sila\u015fi, Yamato Zaharia,
  Cristian Pulhac, Iulian P\u00eetea, Corina Petru\u0163, M\u0103d\u0103lina Linguraru,
  Ana Otvo\u015f, C\u0103t\u0103lin Dumitrescu \u015fi Paula Vieru - \u015fi-a anun\u0163at
  prezen\u0163a la \u015fcoala nr. 11 din Bra\u015fov, s\u00e2mb\u0103t\u0103 de la
  ora 11.\"", "\"Intrebari frecvente\\n- Q?Nu locuiesc in Romania, dar as vrea sa
  discut cu un terapeut roman. Ma puteti ajuta?\\n-\\nA.\\nPentru cei care nu pot
  ajunge la cabinet, exista posibilitatea desfasurarii sedintelor online. Pentru aceasta
  e nevoie sa-ti instalezi programul skype. Pentru a planifica o intalnire online,
  ma puteti contacta telefonic (+40 726 766 714) sau pe e-mail (elena.popescu@psihocentru.ro).
  Sedinta pe skype dureaza intre 50-60 minute.\\n- Q?Cum pot discuta direct cu un
  psiholog?\\n-\\nA.\\nPentru a planifica o intalnire ma puteti suna la numarul de
  telefon +40 726 766 714 sau imi puteti scrie pe adresa de e-mail elena.popescu@psihocentru.ro.\\nVezi
  locatie.\\n- Q?Imi puteti oferi cateva sfaturi in legatura cu starea de neliniste
  pe care o simt?\\n-\\nA.\\nVa pot ajuta explorand impreuna acele elemente care genereaza
  aceasta stare, va pot sprijini in deblocarea situatiei si in descoperirea de noi
  posibilitati de actiune, insa nu va pot oferi sfaturi.\\nConsilierea si psihoterapia
  nu trebuie intelese ca modalitati de sfatuire, iar psihologul vazut drept sursa
  de sfaturi expertale. Principalele roluri ale consilierului si terapeutului sunt
  acelea de a-si insoti clientul in procesul de auto-cunoastere si de a stimula auto-explorarea.
  Consilierul si terapeutul acorda un sprijin avizat in descoperirea de catre client
  a propriilor strategii optime de a face fata sarcinilor vietii.\\nViziteaza sectiunea
  servicii si terminologie.\\n- Q?Cat de des trebuie sa aiba loc sedintele asa incat
  sa se vada rezultatele cat mai repede?\\n-\\nA.\\nDaca ne referim la psihoterapie,
  de obicei sedintele au loc o data pe saptamana, iar spre sfarsitul terapiei se pot
  rari. In functie de problema abordata, sedintele pot fi programate si de doua ori
  sau chiar o data pe luna.\\nNumarul de sedinte necesare pentru a inregistra rezultate
  variaza in functie de problema, uneori o singura sedinta fiind suficienta pentru
  a atinge obiectivul vizitei la psiholog.\\n- Q?Cat dureaza o sedinta de terapie?\\n-\\nA.\\nDurata
  sedintei variaza in functie de tipul de terapie oferit:\\n- terapia individuala
  50 \u2013 60 min\\n- terapia de familie 90 min\\n- terapia de cuplu 90 min\\n- dezvoltare
  personala individuala 50 min\\n- evaluare psihologica 45 \u2013 60 min\\nVezi si
  sectiunea psihoterapie.\"", "\"Este o boala genetica (prezenta de la nastere) caracterizata
  prin afectarea mai multor organe. Exista forme mai severe de Sindrom Cornelia de
  Lange, usor de recunoscut deoarece copilul are toate trasaturile specifice bolii
  si, forme moderate mai greu de diagnosticat. Boala poate aparea la fete si baieti
  prin mutatii la nivelul a trei gene, dar [\u2026]\\nHipotermia mi s-a parut un subiect
  deosebit de interesant, motiv pentru care m-am gandit sa scriu cateva informatii
  despre el. Mi-a venit aceasta idee dupa ce am avut un pacient care a avut cateva
  episoade de hipotermie si a venit impreuna cu familia pentru o evaluare neurologica.
  Examinarea a fost recomandata de medical pediatru pornind [\u2026]\\nEpilepsia cu
  absente mioclonice \u2013 forma rara de epilepsie. Epilepsia cu absente mioclonice
  este asemanatoare cu epilepsia absenta a copilului in ceea ce priveste aspectul
  clinic al manifestarilor, dar este mai severa deoarece crizele sunt mai frecvente,
  mai rezistente la tratament si se insotesc de un declin psihic al copilului. Crizele
  epileptice pot debuta intre [\u2026]\\nDeoarece atat sindromul Landau \u2013 Kleffner
  cat si unele forme de autism sunt caracterizate printr-o dezvoltare aparent normala,
  pana la o anumita varsta, urmata apoi de o afectare a limbajului, a ridicat semne
  de intrebare cu privire la legatura dintre cele doua boli. In ceea ce priveste asemanarile,
