  prietenii, vibrant la evenimente speciale.\\nOaspetii au acces la parcare gratuita.\\nPreturi
  de la 200 RON\"", "\"Am primit de cur\u00e2nd un mail cu ni\u0219te ziceri de duh
  d\u2019ale prichindeilor, pe care a\u0219 vrea s\u0103 le \u00eempart cu voi. Cineva,
