  probabil din link-ul acesta. Cel pu\u021bin, a\u0219a b\u0103nuiesc\u2026\\nIat\u0103
  \u0219i mailul primit\u2026\\nUn grup de psihologi a pus unor copii cu v\u00e2rste
  cuprinse \u00eentre 4-8 ani urm\u0103toarea \u00eentrebare: \u201eCe \u00eenseamn\u0103
  dragostea?\u201d. Acestea sunt r\u0103spunsurile lor.\\n\u201eC\u00e2nd bunica mea
  a f\u0103cut artrit\u0103, nu mai putea s\u0103 se aplece s\u0103-\u0219i fac\u0103
  unghiile de la picioare. A\u0219a c\u0103 bunicul i le face de atunci mereu, de\u0219i
  are \u0219i el artrit\u0103 la m\u00e2ini. Aceasta este dragostea.\u201d (Rebecca,
  8 ani)\\n\u201eC\u00e2nd cineva te iube\u0219te, felul \u00een care-\u021bi roste\u0219te
  numele este diferit. Chiar \u0219tii c\u0103 numele t\u0103u este \u00een siguran\u021b\u0103
  \u00een gura lui.\u201d (Billy, 4 ani)\\n\u201eEste dragoste c\u00e2nd o fat\u0103
  se parfumeaz\u0103, un b\u0103iat se d\u0103 cu after shave, ies \u00eempreun\u0103
  \u00een ora\u0219 \u0219i se miros reciproc.\u201d (Karl, 5 ani)\\n\u201eDragostea
  este ceea ce te face s\u0103 z\u00e2mbe\u0219ti atunci c\u00e2nd e\u0219ti obosit.\u201d
  (Terri, 4 ani)\\n\u201eEste dragoste atunci c\u00e2nd mami \u00eei face cafea lui
  tati \u0219i ia o \u00eenghi\u021bitur\u0103 \u00eenainte de a i-o da, pentru a
  fi sigur\u0103 c\u0103 gustul este OK.\u201d (Danny, 7 ani)\\n\u201eEste vorba de
  iubire atunci c\u00e2nd m\u0103n\u00e2nci \u00een ora\u0219 \u0219i \u00eei dai
