  s\u0103-i ceri \u00een schimb cartofii lui.\u201d (Chrissy, 6 ani)\\n\u201eDragoste
  este atunci c\u00e2nd te s\u0103ru\u021bi tot timpul. Apoi, c\u00e2nd obose\u0219ti
