  stai de vorb\u0103. A\u0219a sunt mami \u0219i tati. Sunt caraghio\u0219i c\u00e2nd
  se s\u0103rut\u0103.\u201d (Emily, 8 ani)\\n\u201eDragostea este ceea ce \u201ese
