  meu care \u00eemi f\u0103cea cu m\u00e2na \u0219i \u00eemi z\u00e2mbea. Era singurul
  care f\u0103cea asta! \u0218i nu mi-a mai fost fric\u0103.\u201d (Cindy, 8 ani)\\n\u201eMama
  m\u0103 iube\u0219te mai mult dec\u00e2t oricine altcineva. Nimeni altcineva nu
