  ridicol.\u201d (Mark, 6 ani)\\n\u201eNu trebuie s\u0103 spui te iubesc dac\u0103
  nu este adev\u0103rat. Dar dac\u0103 este adev\u0103rat, trebuie s-o spui c\u00e2t
  mai des\u2026 Oamenii uit\u0103 asta.\u201d (Jessica, 8 ani)\\nDup\u0103 ce citi\u021bi
