  acolo sute de asemenea vorbe de duh. Desigur, \u00een cazul c\u0103 n-a\u021bi apucat
  s-o face\u021bi deja. Cartea nu mai e de multi\u0219or o noutate pe pia\u021b\u0103.
  At\u00e2ta doar c\u0103 mailul \u0103sta mi-a amintit de ea \u0219i m-am g\u00e2ndit
  c\u0103 nu stric\u0103 s-o ar\u0103t \u00eenc\u0103 o dat\u0103 cu degetul.\\n\u0218i
  \u00eenc\u0103 ceva! Dac\u0103 tot nu v-a\u021bi s\u0103turat s\u0103 privi\u021bi
  lumea prin ochii celor mici, v\u0103 invit s-o face\u021bi \u0219i aici, \u00een
  rubrica \u201eperle \u0219i m\u0103rg\u0103ritare\u201d.\"", "\"Premierul Florin
