  Pariul nu va fi ajustat la urm\u0103torul pariu posibil. Dac\u0103 soldul dvs. scade
  sub pariul total plasat, face\u021bi clic pe butonul afi\u015fat \u00een partea
  de jos a ferestrei de joc..\\n- LINII: 20 de linii vor fi selectate implicit. Pute\u0163i
  s\u0103 mic\u015fora\u0163i num\u0103rul liniilor de c\u00e2\u015ftig, d\u00e2nd
  click pe butonul din st\u00e2nga rubricii \u201eLINII\u201d sau s\u0103 selecta\u0163i
  mai multe linii, d\u00e2nd click pe butonul din partea dreapt\u0103.\\n- PARIU MAX:
  Pentru a juca cu PARIUL MAX, face\u0163i clic pe . Aceast\u0103 op\u0163iune va
  fi dezactivat\u0103, dac\u0103 soldul dvs. este insuficient\\n- Num\u0103rul liniilor
  va fi multiplicat cu \u201epariul pe linie\u201d. Valoarea total\u0103 a mizei va
  fi afi\u015fat\u0103 l\u00e2ng\u0103 rubrica \u201ePARIU\u201d, care se afl\u0103
  \u00een partea de jos a ferestrei de joc.\\n- Tabela de pl\u0103\u021bi: Tabela
  de pl\u0103\u021bi poate fi vizualizat\u0103, d\u00e2nd click pe butonul localizat
  \u00een partea de jos a ecranului de joc, deasupra panoului de control. Premiile
  afi\u015fate \u00een tabela de pl\u0103\u0163i sunt pentru fiecare unitate de pariu
  \u015fi sunt afi\u015fate sub form\u0103 de multiplicatori. Pentru a calcula efectiv
  valoarea pl\u0103\u021bii pe linie, multiplica\u0163i premiul respectiv cu pariul
  pe linie.\\n- Tabela de pl\u0103\u021bi afi\u0219eaz\u0103 pl\u0103\u021bile pentru
  pariul \u0219i liniile curent selectate. Pute\u0163i reveni \u00een joc, f\u0103c\u00e2nd
  clic pe butonul de \u00eenchidere din fereastra tabelei de pl\u0103\u0163i.\\n-
  Rotire: Face\u0163i clic pe icoana \u201eROTIRE\u201d pentru a \u00eenv\u00e2rti
  rolele. Dup\u0103 ce rolele se opresc din rotire, orice combina\u0163ii c\u00e2\u015ftig\u0103toare
  de pe liniile selectate vor fi pl\u0103tite conform tabelei de pl\u0103\u021bi.\\n-
  Rezultat: C\u00e2\u015ftigurile vor fi indicate prin colorarea liniillor de c\u00e2\u015ftig
  cu simboluri animate, iar \u00een cazul c\u00e2\u015ftigurilor scatter, prin simboluri
  animate. C\u00e2\u015ftigul total va fi afi\u015fat \u00een partea de jos a ferestrei
  l\u00e2ng\u0103 rubrica \u201eC\u00c2\u015eTIG\u201d.\\n- Volum: Pictograma va porni
  muzica jocului. D\u00e2nd clic pe icoana volumul va fi dezactivat .\\n- CREDITE:
  Dup\u0103 ce a\u021bi plasat pariul dorit, soldul r\u0103mas de joc va fi afi\u0219at
  la rubrica \u2018SOLD\u2019 , adic\u0103 soldul jocului curent minus pariul total
  plasat.\\n- AUTOSPIN (ROTIRE AUTOMAT\u0102): Pute\u021bi folosi aceast\u0103 func\u021bie
  pentru a alege toate sau oricare dintre diversele op\u021biuni pentru modul de joc
  \u201ef\u0103r\u0103 m\u00e2ini\u201d (automat). \u00cen cadrul acestei func\u0163ii
  sunt disponibile urm\u0103toarele op\u0163iuni:\\n- Num\u0103rul de rotiri: Jocul
  va porni automat num\u0103rul de rotiri selectate din meniul vertical. Pute\u0163i
  opta pentru maxim 1.000 de rotiri \u0219i juca p\u00e2n\u0103 c\u00e2nd soldul dvs.
  este sub valoarea pariului total plasat. Pentru juc\u0103torul din Marea Britanie,
  vor fi disponibile 100 de rotiri automate.\\n- Dac\u0103 c\u00e2\u015ftigul este
  egal cu sau mai mare dec\u00e2t: Jocul va roti p\u00e2n\u0103 ce suma c\u00e2\u015ftigurilor
  va fi egal\u0103 cu sau mai mare dec\u00e2t suma introdus\u0103 \u00een c\u0103su\u021ba
  numeric\u0103.\\n- Dac\u0103 pierderea nu dep\u0103\u015fe\u015fte: Jocul va roti
  automat, p\u00e2n\u0103 c\u00e2nd este atins\u0103 limita de pierdere. Pierderea
  va fi calculat\u0103 cu (Pierdere = Total pariuri - Total c\u00e2\u0219tiguri)\\n-
  Total pariuri = total pariuri acumulate\\n- Total c\u00e2\u0219tiguri = total c\u00e2\u0219tiguri
  acumulate\\n- ((Total pariuri - Total c\u00e2\u0219tiguri) + pariu joc curent) <=
  Valoarea limitei de pierdere), apoi va fi acordat\u0103 urm\u0103toarea rotire automat\u0103.\\n-
  Dac\u0103 func\u0163ia se declan\u015feaz\u0103: jocul va roti automat p\u00e2n\u0103
  la declan\u015farea urm\u0103toarei func\u0163ii\\n- Jocul cu rotire automat\u0103
  va fi terminat de fiecare dat\u0103 c\u00e2nd jackpotul The Big One e declan\u0219at
  \u00eentre rotirile automate.\\n- Pentru a utiliza func\u0163ia de rotire automat\u0103,
  face\u0163i clic pe butonul \u201eROTIRE AUTOMAT\u0102\u201d disponibil \u00een
  partea de jos a ecranului de joc. Odat\u0103 ce fereastra de rotire automat\u0103
  se deschide, da\u021bi clic pe \u201eMai multe\u201d pentru a vizualiza op\u021biunile
  suplimentare. Bifa\u021bi c\u0103su\u021bele din dreptul op\u021biunii(ilor), cu
  care dori\u021bi s\u0103 juca\u021bi. Bifa\u021bi c\u0103su\u021ba de text \u0219i
  introduce\u021bi valoarea limitei, cu care dori\u021bi s\u0103 juca\u021bi. Face\u0163i
  clic pe \u201eSTART\u201d pentru a activa op\u0163iunile selectate \u015fi pentru
  a \u00eencepe rotirile. \u00cen mod similar, face\u0163i clic pe butonul pentru
  a opri func\u0163ia de \u201eROTIRE AUTOMAT\u0102\u201d \u015fi a reveni la ecranul
  de joc.\\n- Atunci c\u00e2nd juca\u0163i cu mai multe op\u0163iuni \u015fi condi\u0163ii
  selectate, condi\u0163ia care este \u00eendeplinit\u0103 prima, va avea prioritate
  fa\u0163\u0103 de celelalte, iar condi\u0163iile selectate r\u0103mase vor fi dezactivate.
  Pute\u0163i ulterior alege, fie s\u0103 selecta\u0163i acela\u015fi set de op\u0163iuni
  de joc din nou, fie s\u0103 opta\u0163i pentru noi op\u0163iuni \u015fi s\u0103
  continua\u0163i s\u0103 juca\u0163i.\\n- Op\u021biunea \u201eROTIRE AUTOMAT\u0102\u201d
  nu este disponibil\u0103 \u00een modul de joc pe bani virtuali.\\n- Repetare pariu/Modificare
  pariu: Pariul implicit pentru urm\u0103toarea rotire va fi acela\u0219i ca suma
  pariat\u0103 \u00een rotirea precedent\u0103. Face\u0163i clic pe \u201eROTIRE\u201d
  pentru a juca din nou cu aceea\u015fi miz\u0103. Pentru a v\u0103 modifica pariul,
  m\u0103ri\u021bi sau mic\u0219ora\u021bi pariul din fereastra de joc.\\n- Credite:
  Dup\u0103 ce a\u0163i plasat pariul dorit, soldul dvs. r\u0103mas este afi\u015fat
  la rubrica \u201eSOLD\u201d. Actualul dvs. sold de joc reprezint\u0103 suma valorilor
  afi\u015fate la rubrica \u201eSOLD\u201d \u015fi la rubrica \u201ePARIU\u201d. Soldul
  dvs. de joc este afi\u015fat \u00een partea de jos a ecranului de joc.\\nSet\u0103ri
  joc:\\n- Pentru a utiliza set\u0103rile de joc, da\u021bi clic pe butonul Set\u0103ri
  de Joc din partea de jos a ecranului de joc, situat \u00eentre tabela de pl\u0103\u021bi
  \u0219i icoanele de sunet.\\n- Volum: Juc\u0103torul poate seta volumul pentru efecte
  sonore, deplas\u00e2nd butonul de volum.\\n- Efecte sonore: Comuta\u021bi \u00eentre
  simbolurile On/Off pentru a activa sau dezactiva sunetele de anima\u021bie pentru
  c\u00e2\u0219tig.\\n- Sunet ambient: Comuta\u021bi \u00eentre simbolurile On/Off
  pentru a activa sau dezactiva sunetul de fundal al jocului.\\n- Rotire rapid\u0103:
  Bif\u00e2nd aceast\u0103 op\u021biune, jocul e mai rapid dec\u00e2t rotirea obi\u0219nuit\u0103.\\n-
  Tasta de spa\u0163iu pentru rotire: Bif\u00e2nd aceast\u0103 op\u021biune, tasta
  de spa\u021biu poate fi utilizat\u0103 pentru a declan\u0219a o rotire. Dac\u0103
  jocul este activat, tasta de spa\u021biu pentru rotire va colecta automat suma c\u00e2\u0219tigului.\\n-
  Func\u021bia de joc: Aceast\u0103 caset\u0103 de selectare este utilizat\u0103 pentru
  activarea sau dezactivarea func\u021biei de joc.\\nREGULI DE JOC:\\n- Juc\u0103torul
  poate intra \u00een joc cu 20 linii variabile de plat\u0103.\\n- Pl\u0103\u0163ile
  sunt efectuate conform tabelei de pl\u0103\u0163i.\\n- Butonul ROTIRE \u00eencepe
  jocul cu PARIUL \u015fi LINIILE selectate \u00een momentul respectiv.\\n- C\u00e2\u015ftigurile
  de pe liniile de plat\u0103 sunt \u00eenmul\u0163ite cu valoarea pariului pe linie.\\n-
  Se pl\u0103te\u015fte cel mai mare c\u00e2\u015ftig de pe fiecare linie de plat\u0103
  selectat\u0103.\\n- C\u00e2\u0219tigurile care coincid pe diferitele linii de plat\u0103
  sunt toate ad\u0103ugate la valoarea dvs. total\u0103 de c\u00e2\u0219tig.\\n- Simbolul
  Wild (moned\u0103 de aur) substituie toate simbolurile cu excep\u021bia simbolurilor
  Femeie, Scut \u0219i Corabie.\\n- Toate simbolurile pl\u0103tesc de la st\u00e2nga
  la dreapta, cu excep\u021bia simbolurilor scatter.\\n- Defec\u0163iunile de sistem
  anuleaz\u0103 toate pl\u0103\u0163ile \u015fi jocul.\\nFUNC\u021aIA DE JOC:\\n-
  Func\u021bia de joc se va declan\u0219a, odat\u0103 ce valoarea c\u00e2\u0219tigului
  pe linie va fi mai mare sau egal\u0103 cu x5 valoarea pariului total \u0219i mai
