  vor fi afi\u0219ate, iar zona cu segmente va avea la baz\u0103 valoarea c\u00e2\u0219tigului
  pe linie.\\n- Juc\u0103torul poate opta s\u0103 joace sau s\u0103 colecteze:\\n-
  Dac\u0103 juc\u0103torul alege op\u021biunea de joc:\\n- Dac\u0103 sabia se opre\u0219te
  \u00een zona \u201eFiord\u201d, atunci func\u021bia \u201eFiordul Bog\u0103\u0163iilor\u201d
  va fi declan\u0219at\u0103, iar valoarea c\u00e2\u0219tigului ob\u0163inut\u0103
  de juc\u0103tor \u00een runda bonus va fi ad\u0103ugat\u0103 direct la soldul juc\u0103torului.\\n-
  Dac\u0103 sabia se opre\u0219te \u00een zona de \u201cculoare ro\u0219ie\u201d,
  atunci juc\u0103torul va pierde suma de joc.\\n- Dac\u0103 juc\u0103torul alege
  op\u021biunea de colectare:\\n- Valoarea de c\u00e2\u0219tig va fi ad\u0103ugat\u0103
  direct la soldul juc\u0103torului.\\n- Dac\u0103 juc\u0103torul alege op\u021biunea
  de joc:\\n- Dac\u0103 orice func\u021bie se declan\u0219eaz\u0103 odat\u0103 cu
  c\u00e2\u0219tigul pe linie, jocul nu va fi activat.\\n- \u00cen timpul rotirilor
  automate, func\u0163ia de joc nu va fi disponibil\u0103.\\nFUNC\u021aIA FEMEIA BANULUI:\\n-
  Femeia Banului va fi activat\u0103 c\u00e2nd 3 sau mai multe simboluri Femeie vor
  ap\u0103rea oriunde pe rol\u0103.\\n- Juc\u0103torul trebuie s\u0103 selecteze oricare
