  \u00een aceast\u0103 rund\u0103 bonus.\\nFUNC\u021aIA C\u00c2\u0218TIGUL R\u0102ZBOINICULUI:\\n-
  Func\u021bia C\u00e2\u0219tigul R\u0103zboinicului se va declan\u0219a, odat\u0103
  ce 3 simboluri Scut vor ap\u0103rea oriunde pe rolele 2, 3 \u0219i 4.\\n- Juc\u0103torul
